%{
Creates a model that can be used to solve the SOS problem on many hexes (removes the pre-processing time for large batches).
It returns a function that acts just like SOS_jacobian_single_hex, but is much faster.
	k			optional, the degree of the SOS relaxation (default 4)
returns:
	model		a function which takes V as an input and returns the lower bound of the jacobian determinant, the argmin,
				and the second eigenvalue
%}

function model = SOS_jacobian_batch_model(k)
	if nargin < 2 k = 4; end

	sdpvar u v w bound;
	sdpvar a(1,20);

	% set up model
	vars = [u, v, w];
	J = a(1) + v.*a(4) + v.^2.*a(7) + a(9).*u + v.*a(12).*u + v.^2.*a(15).*u + a(17).*u.^2 + v.*a(19).*u.^2 + a(2).*w + v.*a(5).*w + v.^2.*a(8).*w +  a(10).*u.*w + v.*a(13).*u.*w + v.^2.*a(16).*u.*w + a(18).*u.^2.*w + v.*a(20).*u.^2.*w + a(3).*w.^2 + v.*a(6).*w.^2 + a(11).*u.*w.^2 + v.*a(14).*u.*w.^2

	[s1, s1_c] = polynomial(vars, k);
	[s2, s2_c] = polynomial(vars, k);
	[s3, s3_c] = polynomial(vars, k);
	[s4, s4_c] = polynomial(vars, k);
	[s5, s5_c] = polynomial(vars, k);
	[s6, s6_c] = polynomial(vars, k);

	domain = [u; 1 - u; v; 1 - v; w; 1 - w];

	F_sos = [sos(s1), sos(s2), sos(s3), sos(s4), sos(s5), sos(s6)];
	F_positiv = sos(J - bound - [s1, s2, s3, s4, s5, s6]*domain);

	[F, obj, m] = sosmodel([F_sos, F_positiv], -bound, [], [s1_c; s2_c; s3_c; s4_c; s5_c; s6_c; bound; a']);
	
	% get the optimizer model
	M = optimizer(F, obj, [], {a}, bound);

	% get length of last constraint, makes finding correct spot in dual easier
	const = F(end);
	const_len = size(const{1}, 1);

	model =  @(V) (apply_model(M, const_len, V));
end

